cmd({
            pattern: "addnote",
            category: "owner",
            desc: "Adds a note on db.",
            filename: __filename
        },
        async(Void, citel, text,{ isCreator }) => {
            if (!isCreator) return citel.reply(tlang().owner)
            if (!text) return citel.reply("ᴘʟᴇᴀsᴇ ɢɪᴠᴇ ᴍᴇ ᴀ ᴛᴇxᴛ ")
            await addnote(text)
            return citel.reply(`ɴᴇᴡ ɴᴏᴛᴇ ${text} ᴀᴅᴅᴇᴅ ɪɴ ᴍᴏɴɢᴏᴅʙ.`)

        }
    )
 
